text:
 @bigboyb3961  ? 대우그룹 분식회계로 따지면 서울이 더 가져간 거 아닌가..
40조를 분식회계 했는데 부산이 5조 밖에 안 가져갔으면 엄청 적게 가져갔네
적어도 30조는 서울이 때먹었단 뜻이잖아

아쉽다 수준이 아니라 그냥 개망한 수준인데 그걸 아쉽다고 해야하는건지;;
애초에 투표 한달전부터 사우디를 공식지지선언한 국가들이 122개국에 달한다는 해외언론들의 보도가 줄을 이었는데
그럼에도 희망고문하면서 팽팽한 접전이니 결선에서 역전할꺼라느니 설레발만 치다 결국 29표 얻고 개망신만 당한 상황

아예 포기한 이탈리아도 17표인데 그런 이탈리아와 12표 차이라니
이건 그냥 아무것도 안해도 29표 받을수있지 않았나 생각될정도;;
